INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (0, 'This version of the ⛷️ Skier emoji has the 🏻 Light Skin Tone applied, which is displayed as a Pale Skin Tone on supported platforms.', '⛷', ' Skier, Type-1-2');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1, 'This version of the ⛷️ Skier emoji has the 🏼 Medium-Light Skin Tone applied, which is displayed as a Cream White Skin Tone on supported platforms.', '⛷', ' Skier, Type-3');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2, 'This version of the ⛷️ Skier emoji has the 🏽 Medium Skin Tone applied, which is displayed as a Moderate Brown Skin Tone on supported platforms.', '⛷', ' Skier, Type-4');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (3, 'This version of the ⛷️ Skier emoji has the 🏾 Medium-Dark Skin Tone applied, which is displayed as a Dark Brown Skin Tone on supported platforms.', '⛷', ' Skier, Type-5');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (4, 'This version of the ⛷️ Skier emoji has the 🏿 Dark Skin Tone applied, which is displayed as a Black Skin Tone on supported platforms.', '⛷', ' Skier, Type-6');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (5, 'A yellow face with simple open eyes and a broad open smile, showing upper teeth and tongue on some platforms. Conveys general pleasure and good cheer or humor. Not to be confused with 😃 Grinning Face With Big Eyes or 😄 Grinning Face With Smiling Eyes, which have the same smiles but more expressive eye shapes. ', '😀', ' Grinning Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (6, 'A yellow face with smiling eyes and full-toothed grin, as if saying “Cheese!” for the camera. Expresses a radiant, gratified happiness. Tone varies, including warm, silly, amused, or proud. Teeth are smoothed over except on Google and Microsoft, which are crosshatched. Not to be confused with 😬 Grimacing Face which looked similar to this emoji on iOS prior to 2017.', '😁', ' Beaming Face With Smiling Eyes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (7, 'A yellow face with a big grin, uplifted eyebrows, and smiling eyes, each shedding a tear from laughing so hard. Widely used to show something is funny or pleasing. Not to be confused with the sad 😭 Loudly Crying Face. One of the ten most popular emojis between 2014–2018 and was named the Oxford Dictionaries 2015 “Word of the Year”.', '😂', ' Face With Tears of Joy');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (8, 'A yellow face with a big grin and scrunched eyes forming an X shape, tilted on its side as if rolling on the floor laughing (the internet acronym ROFL). Conveys hysterical laughter intended to be more intense than 😂 Face With Tears of Joy.', '🤣', ' Rolling on the Floor Laughing');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (9, 'A face with smiling eyes and a broad open smile, showing upper teeth and tongue on some platforms. Conveys general happiness and good-natured amusement. Similar to 😀 Grinning Face but with but with taller, more excited eyes. ', '😃', ' Grinning Face With Big Eyes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (10, 'A happy and smiling face with big open mouth, showing teeth.', '😄', ' Grinning Face With Smiling Eyes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (11, 'A face with a grin and smiling eyes similar to 😄Grinning Face With Smiling Eyes but with a single bead of forehead sweat over its left eye (right on WhatsApp). Intended to depict nerves or discomfort but commonly used as a means of expressing "whew!" or "close call!" that would be implied when a person wipes sweat from their brow in an exaggerated manner.', '😅', ' Grinning Face With Sweat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (12, 'A yellow face with a broad open smile and scrunched-up eyes forming an X shape. Shows excitement and expresses hearty laughter. An emoji form of the >< or xD emoticons. Similar to 😀 Grinning Face but with eyes that say “Squee!” or “Awesome!', '😆', ' Grinning Squinting Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (13, 'A yellow face with a slight, partially open smile and its left eye winking (right on WhatsApp). Signals a joke, flirtation, hidden meaning, or general positivity. Tone varies, including playful, affectionate, suggestive, or ironic. An emoji form of the ;) emoticon. Not to be confused with the more mischievous or sexual 😏 Smirking Face. ', '😉', ' Winking Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (14, 'A yellow face with smiling eyes and a closed smile turning up to rosy cheeks. Expresses genuine happiness and various warm, positive feelings. An emoji form of the ^^ emoticon. Displays on Snapchat next to contacts who message one another often but who aren’t #1 best friends. Consistently a top-ten most popular emoji in the late 2010s. ', '😊', ' Smiling Face With Smiling Eyes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (15, 'A friendly, goofy smile with tongue hanging out the side of the mouth. Used to indicate a silly happiness.', '😋', ' Face Savoring Food');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (16, 'A face smiling and wearing dark sunglasses that is used to denote a sense of cool. The nerd face emoji is a similar face, but with regular glasses.', '😎', ' Smiling Face With Sunglasses');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (17, 'A face with hearts instead of eyes, or Heart Eyes Emoji as it is generally known. Used as an expression of love, for example:  “I love you” or “I love this”.', '😍', ' Smiling Face With Heart-Eyes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (18, 'An emoji face blowing a kiss, usually shown with one eye open and the other eye winking. A heart is shown leaving the kissing mouth.', '😘', ' Face Blowing a Kiss');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (19, 'A face that is shown to be ''in love''. Smiling with blushing cheeks and multiple hearts floating around the face. The number of hearts shown varies by platform.', '🥰', ' Smiling Face With 3 Hearts');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (20, 'This emoji is kissing, but also looks like a whistling emoji, or blowing air. A bit more of an ‘innocent, I’m pretending I didn’t do anything’ whistle, especially if combined with the music note.', '😗', ' Kissing Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (21, 'This emoji is kissing, but also looks like a whistling emoji, or blowing air. A bit more of an ‘innocent, I’m pretending I didn’t do anything’ whistle, especially if combined with the music note.', '😙', ' Kissing Face With Smiling Eyes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (22, 'A face with pursed lips, slightly blushing while making kissing motion. More intimate than the regular kissing face emoji, due to the eyes being closed.', '😚', ' Kissing Face With Closed Eyes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (23, 'This smiling face predates emoji, and works in all manner of older browsers and operating systems.', '☺', ' Smiling Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (24, 'A face with a slight smile and neutral eyes. May be used as a form of passive-aggression or to convey the notion that "this is fine" when things are in fact not fine.', '🙂', ' Slightly Smiling Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (25, 'A face displayed with an open hands gesture, offering a hug. Often used as excited "jazz hands" due to the similarity of appearance to this gesture on a number of platforms.', '🤗', ' Hugging Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (26, 'An excited face showing stars instead of eyes.', '🤩', ' Star-Struck');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (27, 'A face shown with a single finger and thumb resting on the chin, glancing upward. Used to indicate thinking, or deep thought.', '🤔', ' Thinking Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (28, 'A face with a neutral mouth and single eyebrow raised. May be used to denote scepticism, disbelief, or disapproval.', '🤨', ' Face With Raised Eyebrow');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (29, 'A face featuring a straight-and-closed mouth, not giving away any particular emotion.', '😐', ' Neutral Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (30, 'A face with narrow, closed eyes, and a straight mouth. A deliberate display of ‘no comment’ as opposed to a completely neutral face.', '😑', ' Expressionless Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (31, 'This emoji has eyes, and no mouth. Represents silence, as this emoji is always silent. Imagine the things he would say if he had a mouth!', '😶', ' Face Without Mouth');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (32, 'A face displaying eyes glancing upward, indicating an eye-roll. This is used to show disdain, contempt or boredom about a person or topic.', '🙄', ' Face With Rolling Eyes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (33, 'A sly smile, often used with a sexual, or smug connotation. Not to be confused with the unamused face, which has similar eyes, but a displeased mouth.', '😏', ' Smirking Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (34, 'Face with scrunched up and closed eyes, frowning. Used to show helplessness in a situation. May be on the verge of tears.', '😣', ' Persevering Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (35, 'This face has sweat dripping from its brow, due to a stressful situation.', '😥', ' Sad but Relieved Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (36, 'A face with the mouth wide open, which is generally used to represent an element of surprise.', '😮', ' Face With Open Mouth');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (37, 'A face with a zipper displayed instead of a mouth. Used to convey a secret, or that one will not discuss a certain matter with others aka “my lips are sealed”.', '🤐', ' Zipper-Mouth Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (38, 'A face that looks more surprised than hushed, it has high eyebrows, and an open mouth. The appearance is similar to the Astonished face, but with open eyes instead of X eyes.', '😯', ' Hushed Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (39, 'Not to be confused with Sleeping Face Emoji, this sleepy-face emoji features a snot bubble coming out of the nose. This is used in anime and manga to indicate that a character is sleeping.', '😪', ' Sleepy Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (40, 'An exhausted-looking face with an open mouth and tightly closed eyes. On some platforms this emoji is similar in appearance to the Weary Face, and not to be confused with the Sleeping Face which is actually asleep.', '😫', ' Tired Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (41, 'Face with eyes closed, and a sleep symbol – Zzz – over the head', '😴', ' Sleeping Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (42, 'Pleasantly content. Happy, but not over the top. Feeling a sense of relief over a situation, or to convey a calm or content state of mind.', '😌', ' Relieved Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (43, 'A cheeky face sticking its tongue out in jest. Used as a way of stating “I’m kidding” or generally being jovial and not serious.', '😛', ' Face With Tongue');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (44, 'A face showing a stuck-out tongue, winking at the same time. Used in an attempt to be wacky, zany, or otherwise joking.', '😜', ' Winking Face With Tongue');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (45, 'Has both eyes closed, sticking tongue out.', '😝', ' Squinting Face With Tongue');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (46, 'A face shown with drool dripping from one side of the mouth. May be used as a display of desire in a person, object or concept. Previously displayed with a startled appearance on Samsung devices.', '🤤', ' Drooling Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (47, 'This face is not amused. This is not a face of sadness, it is more of a grumpy, displeased look. Used to express dissatisfaction.', '😒', ' Unamused Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (48, 'A face with a sad or neutral mouth, with a single drop of sweat.', '😓', ' Downcast Face With Sweat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (49, 'A pensive, remorseful face. Saddened by life. Quietly considering where things all went wrong.', '😔', ' Pensive Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (50, 'Part displeased, part unsure what to think. This face isn’t sad, but is a bit confused and puzzled by the situation.', '😕', ' Confused Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (51, 'A face that is upside-down, often representing a sense of silliness or goofiness. Sometimes used as an ambiguous emotion, such as joking or sarcasm.', '🙃', ' Upside-Down Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (52, 'A face with a bank note showing instead of a tongue, and dollar signs instead of eyes. Indicates a love of money, or a feeling of wealth.', '🤑', ' Money-Mouth Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (53, 'An astonished face, with a wide open mouth, gasping in shock or surprise.', '😲', ' Astonished Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (54, 'A frowning face with an unhappy mouth curving downward. This face is a more extreme version of the slightly frowning face.', '☹', ' Frowning Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (55, 'A face that is a little bit sad, with a slight frown and neutral eyes.', '🙁', ' Slightly Frowning Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (56, 'On the verge of tears, this emoji has tightly closed eyes, and a quivering mouth.', '😖', ' Confounded Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (57, 'A sad face with a frowning mouth and disappointed eyes.', '😞', ' Disappointed Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (58, 'Face with a sad mouth, and worried-looking eyebrows.', '😟', ' Worried Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (59, 'A face with air coming out of its nose, in a proud yet disdainful way.', '😤', ' Face With Steam From Nose');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (60, 'A sad face with a single tear running from one eye, down the cheek. Hurt and upset, but not crying hysterically.', '😢', ' Crying Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (61, 'A sad face with tears streaming down both cheeks. This face is distraught and inconsolable. Not to be confused with the tears of joy emoji.', '😭', ' Loudly Crying Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (62, 'Face with open eyes and open mouth. The Apple artwork for this emoji looks like a person yawning. Google and Microsoft’s artwork appear closer to the frowning description.', '😦', ' Frowning Face With Open Mouth');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (63, 'This face has raised eyebrows, open eyes and open mouth. A mixture of shock and disappointment.', '😧', ' Anguished Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (64, 'A face with wide open eyes and raised eyebrows. Appears to be shocked by a scary event.', '😨', ' Fearful Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (65, 'A distraught-looking emoji with an open mouth, and crescent shaped eyes. Appears to have given up.', '😩', ' Weary Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (66, 'A face with an explosion taking place in the upper section of the head. May be used to display feelings of shock, awe, or as a visual shorthand for the phrase "mind blown".', '🤯', ' Exploding Head');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (67, 'A grimace emoji, showing bared teeth. Generally used when a mistake or unfavorable situation has arisen – aka “eek!”. This emoji previously looked similar to Grinning Face With Smiling Eyes on iOS.', '😬', ' Grimacing Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (68, 'A look of concern, with a blue forehead and sweat dripping down the cheek.', '😰', ' Anxious Face With Sweat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (69, 'A screaming face with two hands holding the jaw and cheeks in fear. Wide eyes are shown with an open mouth. The Samsung version of this emoji shows a ghost escaping from the mouth.', '😱', ' Face Screaming in Fear');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (70, 'A face that is hot, and possibly sweating from the high temperature.', '🥵', ' Hot Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (71, 'A face that is freezing cold, potentially shown blue with icicles.', '🥶', ' Cold Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (72, 'An embarrassed face with flushed red cheeks. This face is blushing due to a mistake, or other embarrassing situation.', '😳', ' Flushed Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (73, 'A zany face which is excitable and used to represent a certain amount of wackiness. Some platforms display this as a friendly face, while others appear more unhinged.', '🤪', ' Zany Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (74, 'A dizzy face, looking sick or confused from being spun around in circles too many times.', '😵', ' Dizzy Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (75, 'A pouting face outwardly showing displeasure with a person or situation. Displayed with a furrowed brow on most platforms, this emoji is commonly used for mad or angry emotions. Samsung''s version of this emoji includes a red anger symbol on the forehead.', '😡', ' Pouting Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (76, 'An angry looking face. Has inward-facing eyebrows, and a frowning mouth. Expresses anger, grumpiness or annoyance at a situation.', '😠', ' Angry Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (77, 'A face with grawlixes (symbols such as #%!) covering the mouth, indicating that the face is swearing. Used to convey a sudden outburst of anger or frustration.', '🤬', ' Face With Symbols on Mouth');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (78, 'A person with a surgical mask on their face, generally used in a hospital setting, or when working with dangerous fumes.', '😷', ' Face With Medical Mask');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (79, 'A face shown with a thermometer, presumed to be feeling sick. May be used for a patient in hospital, or for a common cold.', '🤒', ' Face With Thermometer');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (80, 'A face showing a bandage wrapped around the head. Used to show someone who has been injured.', '🤕', ' Face With Head-Bandage');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (81, 'A green face, shown with pursed lipsed as though it may be about to vomit. Used literally for sickness, or as a display of disgust.', '🤢', ' Nauseated Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (82, 'A smiley shown to be so throwing up green vomit. May be metaphorically; to emphasise disgust at a person or situation; or in a literal sense.', '🤮', ' Face Vomiting');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (83, 'A face displayed sneezing with a tissue blowing to one side, and closed eyes.', '🤧', ' Sneezing Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (84, 'A face with a halo above it, used to represent an angel, or a good person / person who has done a good deed.', '😇', ' Smiling Face With Halo');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (85, 'A face displayed wearing a wide-brimmed cowboy hat. Shown as a yellow smiley, with non-human appearance.', '🤠', ' Cowboy Hat Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (86, 'A face with distinctively colored face makeup intended to entertain children with physical comedy. May juggle, create balloon animals or perform magic tricks. Some people consider clowns to be terrifying.', '🤡', ' Clown Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (87, 'A face with a party hat, party horn and possibly confetti as well. Used when celebrating a joyous event (such as World Emoji Day).', '🥳', ' Partying Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (88, 'A face which may be showing signs of being tired and emotional, i.e. drunk.', '🥴', ' Woozy Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (89, 'A face which shows large ''begging'' eyes, sometimes referred to as ''puppy dog eyes''.', '🥺', ' Pleading Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (90, 'A face with a long nose, used to indicate the telling of a lie.', '🤥', ' Lying Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (91, 'A face asking for quiet or silence by raising its index finger over its mouth as if to say "shhh" or "shush".', '🤫', ' Shushing Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (92, 'A face shown on most platforms with smiling eyes, seemingly concealing a laugh. This might be considered a cheeky emoji, although often less so than the cheeky monkey covering its mouth.', '🤭', ' Face With Hand Over Mouth');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (93, 'A smiley face shown wearing a monocle. May be used to describe a fancy situation.', '🧐', ' Face With Monocle');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (94, 'A sterotypically “nerd-like” face with glasses, and buck teeth.', '🤓', ' Nerd Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (95, 'A smiling devil-like face. Has an evil-looking smiling face with inward facing eyebrows. In Apple’s artwork, this appears purple, and nearly identical to the Imp emoji.', '😈', ' Smiling Face With Horns');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (96, 'A less-evil version of a demon; the Imp is a cheeky and mischievous character originating in Germanic Folkore.', '👿', ' Angry Face With Horns');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (97, 'A hideous creature with crooked teeth, horns and lots of hair. Called Namahage in Japanapese folklore, this character can be depicted in any number of ways – usually with a coat made of straw and a scary mask.', '👹', ' Ogre');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (98, 'A red mask displayed with thick, hairy eyebrows, and a long nose.', '👺', ' Goblin');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (99, 'A human skull. Not to be confused with the skull and crossbones emoji. Also available as an Animoji on iOS.', '💀', ' Skull');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (100, 'A human skull shown above a crossed pair of bones. Used as a symbol of death, and often as a danger warning on poisenous substances. Not to be confused with the skull emoji.', '☠', ' Skull and Crossbones');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (101, 'Boo! A ghost emoji, trying to scare someone. Might also be a halloween costume.', '👻', ' Ghost');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (102, 'An extra terrestrial alien head, using the stereotypical depiction of an alien with a bald head, large open eyes, and a mouth. Also available as an Animoji on iOS.', '👽', ' Alien');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (103, 'A type of monster or creature that may feature in arcade video games. Often assumed to be an alien, this may have varying appearances across a range of games.', '👾', ' Alien Monster');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (104, 'A robot face, showing a metallic head with eyes and a grill-like mouth that is similar to a grimace. Was available in Gmail prior to its inclusion in Unicode 8. Also available as an Animoji on iOS.', '🤖', ' Robot Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (105, 'A pile of poo that is shaped like a soft-serve ice cream. Brown in color with a friendly smile in most versions of this emoji.', '💩', ' Pile of Poo');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (106, 'The cat variant of the Smiling Face With Open Mouth Emoji.', '😺', ' Grinning Cat Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (107, 'The cat variant of the Grinning Face Emoji.', '😸', ' Grinning Cat Face With Smiling Eyes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (108, 'The cat variant of the Face With Tears Of Joy.', '😹', ' Cat Face With Tears of Joy');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (109, 'The cat variant of the Smiling Face With Heart-Shaped Eyes Emoji. No one knows why we need a cat variant of this.', '😻', ' Smiling Cat Face With Heart-Eyes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (110, 'The cat variant of the Smirking Face Emoji.', '😼', ' Cat Face With Wry Smile');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (111, 'The cat variant of the Kissing Face With Closed Eyes Emoji.', '😽', ' Kissing Cat Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (112, 'The cat variant of the Weary Face Emoji.', '🙀', ' Weary Cat Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (113, 'The cat variant of the Crying Face Emoji.', '😿', ' Crying Cat Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (114, 'A cat that is very grumpy.  Popularised in many memes as Grumpy Cat.', '😾', ' Pouting Cat Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (115, 'One of the three wise monkeys, known as Mizaru.', '🙈', ' See-No-Evil Monkey');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (116, 'One of the three wise monkeys, known as Kikazaru.', '🙉', ' Hear-No-Evil Monkey');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (117, 'One of the three wise monkeys, known as Iwazaru.', '🙊', ' Speak-No-Evil Monkey');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (123, 'The face of a young infant (baby). Shows the face of a baby with a small amount of hair on most platforms, while some variations show a pacifier (dummy) in its mouth. Android previously displayed this emoji as a swaddled baby.', '👶', ' Baby');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (129, 'A child with no gender specified. This may be used as a gender-inclusive alternative to the boy or girl emoji.', '🧒', ' Child');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (135, 'The face of a boy, smiling. Previously differentiated from the man emoji on Android by wearing a cap, and on iOS by the lack of any facial hair.', '👦', ' Boy');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (141, 'The face of a girl, smiling. Differentiated from the woman emoji by the hairstyle which features pigtails which are not present on the woman.', '👧', ' Girl');
