INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1551, 'A speech bubble showing an eye inside. When using text-to-speech on Apple platforms, this emoji is read aloud as: "Eye in speech bubble representing anti-bullying campaign". This emoji was released in conjunction with the Ad Council for the I Am A Witness campaign.', '👁', ' Eye in Speech Bubble');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1552, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1553, 'A bone which may be used for a dog to chew on, or as a part of the human body. The type of bone is not specified.', '🦴', ' Bone');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1554, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1555, 'A tongue, sticking out. May be used as a childish sign of defiance.', '👅', ' Tongue');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1556, 'A human mouth, sometimes displayed as lips instead of the mouth itself.', '👄', ' Mouth');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1557, 'The mark left after a firm kiss is placed with bright lipstick. Used in place of ‘xxx’ (kisses), or to send a kiss to someone. More seductive than the kiss emoji.', '💋', ' Kiss Mark');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1558, 'A heart emoji with an arrow through the center, like the arrow that cupid shoots for love.', '💘', ' Heart With Arrow');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1559, 'A classic love heart emoji, used for expressions of love. Displayed in various shades of red on most platforms. A similar emoji exists for the heart suit in a deck of playing cards.', '❤', ' Red Heart');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1560, 'A heart with vibration / movement lines above it, indicating it is a beating heart. Displayed in pink or red on most platforms, this emoji is intended to be used as a beating heart representing either life, or love.', '💓', ' Beating Heart');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1561, 'A love heart, broken in two. This emoji represents the aching one feels when they are missing the  person they love.', '💔', ' Broken Heart');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1562, 'Two pink love hearts. One larger than the other. Can be used to display that “love is in the air”.', '💕', ' Two Hearts');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1563, 'A pink love heart with stars around it, making it look like it is sparkling or shimmering.', '💖', ' Sparkling Heart');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1564, 'A pink heart, inside a slightly larger pink heart, inside a larger-again pink heart. Intended to give the impression of a heart increasing in size.', '💗', ' Growing Heart');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1565, 'A blue heart emoji.', '💙', ' Blue Heart');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1566, 'A green heart emoji.', '💚', ' Green Heart');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1567, 'A yellow or gold colored love-heart. Inexplicably, this displayed as a pink hairy heart on Android 4.4.', '💛', ' Yellow Heart');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1568, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1569, 'A purple heart emoji. Shown as pink in Android 4.4.', '💜', ' Purple Heart');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1570, 'A heart shaded completely black. May be used to express morbidity, sorrow, or a form of dark humor.', '🖤', ' Black Heart');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1571, 'A heart-shaped box, tied with a ribbon. May be a gift box, box of chocolates, or a jewellery box.', '💝', ' Heart With Ribbon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1572, 'Hearts revolving around one or more other hearts. This emoji was originally animated on a number of Japanese devices.', '💞', ' Revolving Hearts');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1573, 'A decorative heart that displays on Apple devices as a white heart-shaped cutout in a pink or purple roundrect.', '💟', ' Heart Decoration');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1574, 'A decorative exclamation mark, where a heart forms the top part of the symbol, and a circle the lower part. Similar to the way to the man in business suit levitating also creates a similar shape.', '❣', ' Heavy Heart Exclamation');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1575, 'A white envelope, sealed with a sticker or seal of a red love heart. Contains a love letter.', '💌', ' Love Letter');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1576, 'A series of three Zs making a Zzz. Represents sleeping, snoring, dreaming, or any sleep-related state. Can also be used in some contexts to represent something that is boring.', '💤', ' Zzz');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1577, 'A red symbol found in Anime/Manga and used to represent the veins popping on a very angry person.', '💢', ' Anger Symbol');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1578, 'A bomb, with a lit fuse. This means it is soon to explode.', '💣', ' Bomb');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1579, 'A symbol that represents a crash or collision. An angular burst of orange and red in a star-like shape.', '💥', ' Collision');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1580, 'Beads of sweat splashing in a single direction. Is not distinguishable from splashing water, and is often used as water instead of sweat.', '💦', ' Sweat Droplets');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1581, 'A gust of air, representing the fast movement of a person or object to the left of this character. Can be used in combination with another emoji to express motion, such as a fast runner 🏃💨 or fast car  🚗💨.', '💨', ' Dashing Away');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1582, 'A symbol used in comics or other visual mediums, indicating that a person is dizzy.', '💫', ' Dizzy');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1583, 'A cartoon-style balloon used to represent spoken word in comics. Sometimes  used in communication apps to indicate that another person is typing a message.', '💬', ' Speech Balloon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1584, 'A left-facing speech bubble, which was included in Unicode 7.0, but not considered a standard addition for the purposes of emoji presentation.', '🗨', ' Left Speech Bubble');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1585, 'A form of speech balloon used with angular edges, used to denote angry speech in comics.', '🗯', ' Right Anger Bubble');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1586, 'A large cloud-like shape more commonly known as a thought bubble.', '💭', ' Thought Balloon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1587, 'A round, cartoon-style hole in the ground. May be used in the context of "crawling into a hole" in a shameful or embarrassing situation.', '🕳', ' Hole');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1588, 'Prescription glasses, shown with a variety of frames, depending on platform.', '👓', ' Glasses');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1589, 'Sunglasses that can be worn outside for protection from the sun. Often association with connotations of being "cool", or leisurely in sunny places.', '🕶', ' Sunglasses');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1590, 'Goggles of a type that are not specified, but implied to be safety goggles instead of swimming goggles.', '🥽', ' Goggles');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1591, 'A white coat worn in a science laboratory.', '🥼', ' Lab Coat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1592, 'A necktie commonly worn at work or formal occasions.', '👔', ' Necktie');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1593, 'A plain t-shirt, that can be worn by men or women. Displayed as a blue polo shirt on iOS, Facebook and Firefox OS. A white t-shirt on Android and Windows, and yellow or green on other platforms.', '👕', ' T-Shirt');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1594, 'Denim jeans, worn by men or women. A popular form of casual trousers worn by the runner emoji in Apple''s emoji artwork', '👖', ' Jeans');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1595, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1596, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1597, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1598, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1599, 'A pretty dress, suitable for a ball, party or other similar occasion.', '👗', ' Dress');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1600, 'A traditional Japanese robe that can be worn by women or men.', '👘', ' Kimono');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1601, 'A two-piece bikini, worn at the beach, pool, or on vacation at a tropical destination.', '👙', ' Bikini');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1602, 'A blouse worn by women in a neat-casual setting.', '👚', ' Woman’s Clothes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1603, 'A place to keep coins and perhaps notes of money, for females. The male equivalent would be a wallet.', '👛', ' Purse');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1604, 'A handbag, used predominantly by women to carry personal items and/or as a fashion accessory.', '👜', ' Handbag');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1605, 'A small pouch, somewhere between the size of a handbag, and a purse.', '👝', ' Clutch Bag');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1606, 'Bags used for items purchased while shopping. May contain groceries, clothing, or other consumer items.', '🛍', ' Shopping Bags');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1607, 'A school bag Emoji (also called a satchel) used by children attending school to carry books, lunch, and other personal belongings.', '🎒', ' Backpack');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1608, 'A shoe worn by a man, to work, dinner, or another occasion that requires footwear. Unlike womens shoes, this shoe is likely to be comfortable.', '👞', ' Man’s Shoe');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1609, 'A sneaker – a comfortable shoe used in sports such as tennis or golf, or for fashion purposes.', '👟', ' Running Shoe');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1610, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1611, 'A flat shoe, in a style generally worn by women. More practical than a high-heeled shoe.', '🥿', ' Flat Shoe');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1612, 'A high-heeled shoe, primarily worn by women. Generally found in a context which requires formal dress, such as social occasions, or some work places.', '👠', ' High-Heeled Shoe');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1613, 'A sandal worn by a woman in summer, spring, or other weather that suits open-toed footwear. Has a heel at the back providing additional height to the wearer.', '👡', ' Woman’s Sandal');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1614, 'A tall boot generally featuring a slight heel, shown in brown or red on most platforms.', '👢', ' Woman’s Boot');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1615, 'A gold crown with jewels on the sides. Representative of a King, Queen, or other form of Royalty.', '👑', ' Crown');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1616, 'A hat worn by women for sun protection, or for fashion.', '👒', ' Woman’s Hat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1617, 'A top hat, worn in traditional British weddings and other formal occasions. This is also a popular playing piece in the game of Monopoly.', '🎩', ' Top Hat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1618, 'A graduation cap, worn on the head of students graduating from college or university. Known in some locations as a mortar board with tassel.', '🎓', ' Graduation Cap');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1619, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1620, 'A construction helmet, which is worn by the construction worker emoji in some emoji sets.', '⛑', ' Rescue Worker’s Helmet');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1621, 'Prayer beads, generally shown with a decorative tassel. Used by people of various religious traditions. This emoji previously displayed with a cross instead of a tassel on some platforms.', '📿', ' Prayer Beads');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1622, 'Lipstick shown with the lid removed. Displays in a shade of red on most platforms, except Android which has a pink color.', '💄', ' Lipstick');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1623, 'A ring with displaying a gem stone of some kind on the top, most likely a diamond. This piece of jewellery is often associated with a proposal and subsequent engagement to be married.', '💍', ' Ring');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1624, 'A gem that appears blue on screen, but is presumably intended to appear of similar shade to a diamond.', '💎', ' Gem Stone');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1625, 'The face of a monkey. Similar to the monkey emoji, but only showing the head, and not the entire body. Also available as an Animoji on iOS.', '🐵', ' Monkey Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1626, 'A cheeky looking monkey, sitting down with tail curled up.', '🐒', ' Monkey');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1627, 'A gorilla, displayed either as the entire animal, or just the face.', '🦍', ' Gorilla');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1628, 'The face of a dog, showing both eyes, both ears, nose and mouth. Shows the face of a dog smiling, with eyes open and tongue hanging out.', '🐶', ' Dog Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1629, 'A dog, which appears as various different breeds depending on the platform it is being viewed on.', '🐕', ' Dog');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1630, 'A poodle is a breed of dog, commonly seen groomed with longer hair around the head, paws and tail than the rest of the body.', '🐩', ' Poodle');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1631, 'A wolf shown with gray fur, black nose, and pointed ears on most platforms.', '🐺', ' Wolf Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1632, 'A fox face, shown with pointy ears. At small sizes may be difficult to discern from a wolf face. Also available as an Animoji on iOS.', '🦊', ' Fox Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1633, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1634, 'The face of a cat, looking directly forward. Shown as yellow or gray on most platforms, this emoji generally has a cartoon-style appearance and visible whiskers.', '🐱', ' Cat Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1635, 'A domestic house cat, shown facing left-of-screen on all major platforms. Distinct from the cat face emoji, this cat emoji shows the full body of the animal including the tail, which is generally upright.', '🐈', ' Cat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1636, 'The face of a lion, often referred to as the king of the jungle. Displays with a cute, cartoon-style face in Apple''s artwork that appears to be slightly sad, or timid. Also available as an Animoji on iOS.', '🦁', ' Lion Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1637, 'A tiger face, which is displayed on major platforms with a cute cartoon appearance.', '🐯', ' Tiger Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1638, 'A tiger emoji; orange with black stripes. Created in a photorealistic style in Apple’s artwork, and cartoon style in Google’s version.', '🐅', ' Tiger');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1639, 'A leopard emoji which has a yellow or gold colored coat with black spots.', '🐆', ' Leopard');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1640, 'A horse’s head, shown facing forward or to the left of screen on most platforms. Looks to the right on Facebook. Distinct from the horse emoji which shows the entire horse, and not just the face.', '🐴', ' Horse Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1641, 'A galloping horse with saddle. The same as the Horse Racing Emoji, but without a jockey riding it. Created in a photorealistic style in Apple’s artwork, and cartoon style in Google’s version.', '🐎', ' Horse');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1642, 'A mythical creature generally depicted as a white horse, with a long horn. Also available as an Animoji on iOS.', '🦄', ' Unicorn Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1643, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1644, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1645, 'A friendly-looking cow face, looking straight ahead.', '🐮', ' Cow Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1646, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1647, 'A Domestic Water Buffalo, used primarily for tilling (ploughing) rice fields in parts of Asia.', '🐃', ' Water Buffalo');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1648, 'A cow with a black and white patched coat, likely a Holstein Freisan breed.', '🐄', ' Cow');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1649, 'A pig’s head, distinct from the pig emoji, which shows the full pig body. Displayed forward-facing, with a distinctive snout. Also available as an Animoji on iOS.', '🐷', ' Pig Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1650, 'A domestic pig, whose ancestor is the wild boar. This farm animal has been created in a photorealistic style in Apple’s artwork, and cartoon style in Google’s version.', '🐖', ' Pig');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1651, 'A boar, otherwise known as a wild pig. Displayed with brown fur and prominent tusks on most platforms.', '🐗', ' Boar');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1652, 'A pig’s snout / nose.', '🐽', ' Pig Nose');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1653, 'A male sheep, known as a ram, with spiralled horns.', '🐏', ' Ram');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1654, 'A white sheep which is similar in appearance to the ram emoji. May be found on a farm.', '🐑', ' Ewe');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1655, 'A goat, displayed in white, gray, or brown depending on platform.  Previously appeared as a Saanen goat on iOS, but changed to a Toggenberg goat in recent versions.', '🐐', ' Goat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1656, 'A camel with one bump, found in parts of Africa and India. More common than the two-bump Bactrian Camel.', '🐪', ' Camel');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1657, 'A camel with two bumps found primarily in Central Asia. Much rarer than the single-bump Dromedary Camel.', '🐫', ' Two-Hump Camel');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1658, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1659, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1660, 'A large elephant, found in parts of Africa and Asia.', '🐘', ' Elephant');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1661, 'A rhinoceros, displayed either as the entire animal, or just the face.', '🦏', ' Rhinoceros');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1662, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1663, 'A mouse face, drawn in cartoon-style with whiskers and two rounded ears.', '🐭', ' Mouse Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1664, 'A small white mouse shown full-body, as opposed to the mouse face emoji.', '🐁', ' Mouse');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1665, 'A rat emoji, not to be confused with the mouse emoji.', '🐀', ' Rat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1666, 'A cute hamster, with pink ears, orange over half its face, and white/gray for the other part of the face. Has three whiskers on each side.', '🐹', ' Hamster Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1667, 'A cute, cartoon-styled rabbit face, shown with two long ears. Some platforms display this emoji with buck teeth.', '🐰', ' Rabbit Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1668, 'A white rabbit, sometimes associated with Spring and Easter.', '🐇', ' Rabbit');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1669, 'A chipmunk emoji, which looks similar to a squirrel. Shown in brown, with a bushy tail. Often shown eating an acorn or chestnut.', '🐿', ' Chipmunk');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1670, 'A hedgehog, generally shown from the side or front. Appears to be smiling on a number of platforms. Though unrelated, some may use this as an Echidna.', '🦔', ' Hedgehog');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1671, 'A black bat that enjoys the dark, shown spreading its wings.', '🦇', ' Bat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1672, 'A cute bear face, displayed more like a teddy bear emoji than an accurate depiction of a real bear. Also available as an Animoji on iOS.', '🐻', ' Bear Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1673, 'A koala emoji, a native Australian marsupial that lives in the trees. Known for sleeping and eating the leaves of the eucalyptus tree.', '🐨', ' Koala');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1674, 'The head of a panda, shown to be smiling on some platforms. Displayed in black and white, with some shades in between. Also available as an Animoji on iOS.', '🐼', ' Panda Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1675, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1676, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1677, 'Paw prints left by a dog or cat, possibly after wandering through paint.', '🐾', ' Paw Prints');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1678, 'A turkey, a bird that is often cooked and eaten at Thanksgiving or Christmas. This emoji displays as a live turkey (similar to the presentation of the bird emoji) as opposed to turkey meat such as the poultry leg.', '🦃', ' Turkey');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1679, 'A chicken with a yellow beak, red comb on top of the head, and red wattle (under the chin). Not to be mistaken with the rooster emoji. Also available as an Animoji on iOS.', '🐔', ' Chicken');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1680, 'A rooster; a male chicken known also as a cockerel or cock.', '🐓', ' Rooster');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1681, 'A cute baby chicken hatching from its egg and seeing the world for the first time.', '🐣', ' Hatching Chick');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1682, 'A small, yellow, baby chick (chicken).', '🐤', ' Baby Chick');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1683, 'A baby chicken (chick), facing forward.', '🐥', ' Front-Facing Baby Chick');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1684, 'A bird, with no species specified. Appears like a sparrow on Android (blue, previously yellow), Windows (blue) and Twitter (red). Only shows the head of the (gray) bird in Apple’s artwork.', '🐦', ' Bird');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1685, 'A penguin shown with a yellow or orange colored beak. Displayed as a face on some platforms, and the full body of a penguin on other platforms.', '🐧', ' Penguin');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1686, 'A dove, carrying an olive branch, as a symbol of peace.', '🕊', ' Dove');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1687, 'An eagle, soaring through the sky. Also the national embled for the United States.', '🦅', ' Eagle');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1688, 'A bird that enjoys spending its time on water. Shown on most platforms as a mallard with brown, white and green colors.', '🦆', ' Duck');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1689, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1690, 'An owl, shown facing forward, with two large eyes and a yellow beak.', '🦉', ' Owl');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1691, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1692, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1693, 'A frog emoji, showing the green face of a frog, with large eyes and mouth.', '🐸', ' Frog Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1694, 'A crocodile emoji, a creature often mistaken for an alligator. Displayed photorealistically on some platforms; while others show this as a cute cartoon crocodile.', '🐊', ' Crocodile');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1695, 'A turtle with shell. Looks similar to a tortoise.', '🐢', ' Turtle');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1696, 'A small lizard, shown in green or brown colors, often from above.', '🦎', ' Lizard');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1697, 'A green, coiled snake sticking out its forked tongue.', '🐍', ' Snake');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1698, 'The face of a dragon, showing only the head. Shown primarily in green on most platforms. Also available as an Animoji on iOS.', '🐲', ' Dragon Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1699, 'As a mythological creature, the dragon is generally displayed in many Chinese and Japanese traditions.', '🐉', ' Dragon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1700, 'A dinosaur with a long neck, tail, and four thick legs. Common examples include the Brachiosaurus, Diplodocus, and Brontosaurus.', '🦕', ' Sauropod');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1701, 'A Tyrannosaurus rex; a large carnivore with a heavy tail, and short arms. This is one of two dinosaur emojis.', '🦖', ' T-Rex');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1702, 'A whale emoji, spouting water out of its blowhole. Shows with a more cartoon-like appearance on iOS, compared to the regular whale emoji.', '🐳', ' Spouting Whale');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1703, 'A large, blue whale emoji. Appears to be a humpback whale in Apple’s artwork. Distinct from the spouting whale emoji.', '🐋', ' Whale');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1704, 'A dolphin emoji, leaping in the air. Considered to be one of the most intelligent animals on Earth.', '🐬', ' Dolphin');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1705, 'A fish emoji, swimming in a non-tropical climate.', '🐟', ' Fish');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1706, 'A fish that lives in tropical (warm) water, generally colorful in appearance.', '🐠', ' Tropical Fish');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1707, 'A spiky-looking fish which is eaten as a delicacy in Japan, where it is known as fugu.', '🐡', ' Blowfish');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1708, 'A shark swimming in the ocean, often displayed with a blue or gray tone.', '🦈', ' Shark');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1709, 'An octopus emoji which displays two eyes and between four and eight tentacles on most platforms.', '🐙', ' Octopus');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1710, 'A seashell found at the beach. It has a spiral shape, and may become home to a hermit crab.', '🐚', ' Spiral Shell');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1711, 'A crab, shown with claws. May be used in relation to the zodiac symbol for cancer.
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1712, 'A lobster emoji, shown from the top-down in Emojipedia''s sample image. Initial complaints about Emojipedia''s sample image being anatomically inaccurate were resolved in a later release.', '🦞', ' Lobster');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1713, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1714, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1715, 'A snail shown with distinctive spiral shell. Differs greatly in color and style across different platforms.', '🐌', ' Snail');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1716, 'A butterfly shown with wings spread. Commonly displayed as a Monarch Butterfly (with orange and black wings) or a Morpho Butterfly (with blue and black wings).', '🦋', ' Butterfly');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1717, 'An insect, which appears to be a caterpillar in Apple’s Artwork, and a centipede or millipede in the Google and Microsoft versions.', '🐛', ' Bug');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1718, 'A small, black ant shown with three to eight legs depending on platform vendor. Display colors include black, grey, and red.', '🐜', ' Ant');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1719, 'A bee emoji, buzzing in the air. Shown with yellow and black stripes, and light colored wings.', '🐝', ' Honeybee');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1720, 'A ladybug emoji, the colloquial name for the coccinellidae family of small beetles. Known as a ladybird or lad beetle in some countries.', '🐞', ' Lady Beetle');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1721, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1722, 'A black spider with eight legs, with similar appearance to a funnel-web spider.', '🕷', ' Spider');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1723, 'A spider web, shown in the symmetrical orb web shape commonly seen in cartoon form.', '🕸', ' Spider Web');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1724, 'A scorpion shown with eight legs and an upright rail. May also be used in relation to the zodiac sign Scorpius.', '🦂', ' Scorpion');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1725, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1726, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1727, 'A collection of colorful flowers arranged in a bouquet and often given as a gift for a wedding, mother’s day, valentine’s day, or other occassion.', '💐', ' Bouquet');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1728, 'A pretty, light-pink flower in bloom. The cherry blossom is very popular in Japan and Japanese art. Weather forecasts track the cherry blossom front across Japan each year.', '🌸', ' Cherry Blossom');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1729, 'An emoji symbol of a white flower, often a cherry blossom.', '💮', ' White Flower');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1730, 'A round flower decoration, in a similar shape to a flower blossom. May be found used on ancient sculptures, as well as modern military awards.', '🏵', ' Rosette');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1731, 'A single red rose emoji. Sometimes used as a display of romance, or for their pleasant smell.', '🌹', ' Rose');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1732, 'A flower that has died, or wilted due to a lack of water. A petal falls toward the ground.', '🥀', ' Wilted Flower');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1733, 'A hibiscus emoji, a pretty flower that can be used to attract butterflies and bees.', '🌺', ' Hibiscus');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1734, 'A sunflower emoji. Bright and yellow. Give it to someone to make them smile!', '🌻', ' Sunflower');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1735, 'A blossoming flower. Similar to the cherry blossom, but not necessarily the same shade. Blossom is also the name of a popular TV Show in the early 1990s.', '🌼', ' Blossom');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1736, 'A single tulip emoji. Commonly seen at tulip festivals in locations around the world with a dutch heritage.', '🌷', ' Tulip');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1737, 'A seedling, a sign of spring. A new plant of some kind sprouting from the earth, hoping to grow into a large tree, flower or plant if conditions are suitable.', '🌱', ' Seedling');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1738, 'A type tree found in nature that doesn’t lose its leaves seasonally, but stays green all year around.', '🌲', ' Evergreen Tree');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1739, 'A type of tree that has leaves turn orange or brown and fall off during the season of fall / autumn.', '🌳', ' Deciduous Tree');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1740, 'A palm tree, commonly found in tropical and otherwise warm climates. Often represents a vacation or holiday destination.', '🌴', ' Palm Tree');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1741, 'A cactus emoji, usually found in warm or desert climates. Most commonly displayed as a three-branch Saguaro cactus.', '🌵', ' Cactus');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1742, 'A rice crop, growing in the ground before harvesting.', '🌾', ' Sheaf of Rice');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1743, 'A herb, such as basil or oregano. Appears on most platforms as a small, green plant with 3-6 leaves.', '🌿', ' Herb');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1744, 'A three-leaf clover, otherwise known as a shamrock. Commonly used on St Patrick''s Day in Ireland and around the world, as it is said that he used the shamrock as a symbol to explain the Christian Holy Trinity.', '☘', ' Shamrock');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1745, 'A four-leaf clover is a less common variety of the three-leaved clover. Considered to be lucky.', '🍀', ' Four Leaf Clover');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1746, 'A red, orange or yellow maple leaf, often associated with Canada due to the maple leaf on the Canadian Flag.', '🍁', ' Maple Leaf');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1747, 'A fallen leaf (or leaves), as would be seen in the season of fall or autumn.', '🍂', ' Fallen Leaf');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1748, 'A leaf (or leaves in the Apple artwork) fluttering in a gentle breeze, falling to the ground.', '🍃', ' Leaf Fluttering in Wind');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1749, 'A grape bunch, as cut from the vine and used to make wine. Depicted as red (purple-colored) grapes.', '🍇', ' Grapes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1750, 'A melon fruit in a light greenish-brown rind. Depicted as a cantaloupe by most platforms, but can resemble a honeydew at a distance.', '🍈', ' Melon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1751, 'A slice of watermelon, showing its rich pink flesh, black seeds, and green rind.', '🍉', ' Watermelon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1752, 'An orange-colored citrus fruit with a green leaf or leaves and stem. Officially depicting a tangerine, a type of mandarin (mikan in Japan). Often used as a garden-variety orange. Either way, a good source of vitamin C.', '🍊', ' Tangerine');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1753, 'The sour, yellow-colored citrus fruit of the lemon, usually with a stem and green leaf or leaves.', '🍋', ' Lemon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1754, 'A ripe banana, peeled and ready to eat on major platforms. Great snack for a child or monkey.', '🍌', ' Banana');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1755, 'The tropical fruit of a pineapple, shown in spiky, golden-brown skin and with a pointed, green crown. Positioned upright or at a 45° angle.', '🍍', ' Pineapple');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1756, 'The ripe fruit of a tropical mango. Variously depicted in shades of yellow, red, orange, and green with a single, green leaf and stem.', '🥭', ' Mango');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1757, 'A classic red apple, shown with a stem and single, green leaf on major platforms. Commonly associated with doctors, teachers, and New York.', '🍎', ' Red Apple');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1758, 'A common green apple, tarter counterpart to the Red Apple. Displayed with a stem and single, green leaf on major platforms.', '🍏', ' Green Apple');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1759, 'A light-green variety of a common pear, shown with a stem and sometimes green leaf.', '🍐', ' Pear');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1760, 'The fleshy, pinkish-orange fruit of the fuzzy peach, shown with green leaves and sometimes a stem.', '🍑', ' Peach');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1761, 'Two rich red cherries with a green leaf and joined at their long stems.', '🍒', ' Cherries');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1762, 'The fruit of a rich red strawberry dotted with seeds and crowned with green leaves. Google previously depicted the fruit in orange.', '🍓', ' Strawberry');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1763, 'A kiwifruit, or Chinese gooseberry, with its fuzzy, brown skin sliced open to show its light-green flesh, white core, and black seeds. ', '🥝', ' Kiwi Fruit');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1764, 'A plump, red garden tomato topped with a leafy green stem. May resemble the red apple at small sizes.', '🍅', ' Tomato');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1765, 'The hairy shell of a tropical coconut, cracked in a half to show its milky-white meat. Google displays a whole coconut alongside a half-shell. ', '🥥', ' Coconut');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1766, 'A pear-shaped avocado, sliced in half to show its yellow-green flesh and large brown pit. Ready for toast, guacamole, or millennial jokes.', '🥑', ' Avocado');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1767, 'A long, bulbous, bright purple eggplant, or aubergine in British English, shown with a leafy stem. Considered lucky in Japan to dream of an eggplant the first night of the New Year. ', '🍆', ' Eggplant');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1768, 'A whole potato—such as a russet, used for baking, mashing, or frying—shown with a few eyes on its golden-brown skin. Not to be confused with the roasted sweet potato.', '🥔', ' Potato');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1769, 'A whole, bright orange carrot, topped with long green leaves, as if freshly plucked from the garden. Some platforms feature a longer, thinner carrot, others a shorter, more bulbous one.', '🥕', ' Carrot');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1770, 'An ear of corn, or maize, partially husked to show its buttery-yellow kernels.', '🌽', ' Ear of Corn');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1771, 'A bright red Mexican chili pepper, slightly curled and with a green stem. May be used to represent something “hot and spicy,” figuratively or literally, as a dish on a restaurant menu.', '🌶', ' Hot Pepper');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1772, 'A long, green cucumber with bumpy skin. Resembles its derived product, a pickle or gherkin, on many platforms, except on Apple and WhatsApp, which depict it with light-green, seed-y slices.', '🥒', ' Cucumber');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1773, 'A head of a rich green leaf vegetable, usually shown with white stalks. May be used to represent a variety of greens, including romaine lettuce, chard, and Chinese cabbage like bok choy, as commonly cooked in Asian cuisines. ', '🥬', ' Leafy Green');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1774, 'A rich green, tree-like head or floret of broccoli. ', '🥦', ' Broccoli');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1775, 'The edible fungus of the mushroom, depicted as a toadstool with a white-spotted red cap and stem.', '🍄', ' Mushroom');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1776, 'The pod of the peanut, shown in its rounded, grooved, light-brown shell. Apple depicts a pair.', '🥜', ' Peanuts');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1777, 'The reddish-brown, acorn-shaped chestnut, tapering to a sharp tip from its light brown base on most platforms. A popular roasted snack associated with autumn and Christmas. ', '🌰', ' Chestnut');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1778, 'A loaf of white or wheat bread, as before it is sliced for toast or sandwiches.', '🍞', ' Bread');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1779, 'The flaky, golden-brown crescent of a croissant, a breakfast pastry associated with France and Austria.', '🥐', ' Croissant');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1780, 'The long, thin loaf of a baguette, with scoring on its golden-brown crust. A bread commonly associated with France.', '🥖', ' Baguette Bread');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1781, 'The heart-shaped twist of a hard or soft golden-brown pretzel, seasoned with grains of salt. A snack commonly associated with Germany.', '🥨', ' Pretzel');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1782, 'The brown bread of a bagel, shown sliced in two halves. Some platforms depict seeds, as sesame or poppy, and a schmear of cream cheese, with the bagel assembled as a sandwich. May resemble the Doughnut at small sizes.', '🥯', ' Bagel');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1783, 'A stack of breakfast pancakes, topped with a pad of butter and maple syrup oozing down its golden-brown sides, onto a plate on some platforms. Associated with the Christian observance of Shrove Tuesday, or "Pancake Day."', '🥞', ' Pancakes');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1784, 'A wedge of yellow-orange cheese with holes, like a Swiss, but used for the food in general. May be used for various cheese-related slang expressions (e.g., “cheesy,” “say cheese,” “big cheese”).', '🧀', ' Cheese Wedge');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1785, 'A hunk of unspecified meat on a white bone, as associated with cartoon cavepersons or food in anime and manga (Japanese ano niku, “that meat”).', '🍖', ' Meat on Bone');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1786, 'A crispy brown leg (drumstick) of chicken, duck, turkey, or other poultry on the bone, as roasted at Thanksgiving or Christmas dinner or fried at fast-food restaurants.', '🍗', ' Poultry Leg');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1787, 'A cut of uncooked red meat, as a T-bone or rib-eye steak, with the light, white marbling of fat.', '🥩', ' Cut of Meat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1788, 'Strips of crispy, fatty, reddish-brown bacon, as fried for breakfast. Depicted as a pair on most platforms.', '🥓', ' Bacon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1789, 'A burger with a beef patty, usually depicted on a sesame bun with cheese, lettuce, and tomato—making it a cheeseburger, though officially called Hamburger by Unicode.', '🍔', ' Hamburger');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1790, 'Thin-cut, golden-brown French fries, served in a red carton, as at McDonald’s. Apple features Smiling Face With Smiling Eyes on its carton.', '🍟', ' French Fries');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1791, 'A slice of pepperoni pizza, topped with black olives on Google. WhatsApp adds green pepper, Samsung white onion.', '🍕', ' Pizza');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1792, 'The cooked sausage of a hot dog in a sliced bun and drizzled with yellow mustard, as eaten at a baseball game. ', '🌭', ' Hot Dog');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1793, 'A sandwich, as eaten at lunch, made with lettuce, tomato, and cheese on slices of white or wheat bread. Apple, Google, and WhatsApp add a deli meat that resembles ham.', '🥪', ' Sandwich');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1794, 'A Mexican or Tex-Mex taco on a hard or soft corn tortilla, filled with such ingredients as beef, lettuce, tomato, cheese, and onion. Apple’s design resembles a carne asada taco, with cilantro and white onion.', '🌮', ' Taco');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1795, 'A Mexican or Tex-Mex burrito, featuring a wrapped flour tortilla filled with such ingredients as beef, rice, beans, cheese, tomato, lettuce, and sour cream. Served in foil on several major platforms, suggesting a Mission burrito associated with San Francisco. Not to be confused with the Stuffed Flatbread.', '🌯', ' Burrito');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1796, 'A flatbread, like pita, stuffed with lettuce, tomato, and/or meat. Resembles a doner kebab, falafel, shawarma, or gyro sandwich, popular in the Middle East and the Mediterranean. Apple and WhatsApp add red onion and cucumber. Not to be confused with the Burrito.', '🥙', ' Stuffed Flatbread');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1797, 'An egg, most commonly displayed as a chicken egg with a white or light brown shell. May be used in cooking.', '🥚', ' Egg');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1798, 'An egg with yolk frying in a skillet, as prepared sunny-side up. Though associated with breakfast, the emoji represents the general action of cooking and related concepts.', '🍳', ' Cooking');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1799, 'A flat, shallow, black pan with side handles, containing saffron-colored rice, vegetables, a leg of poultry, and/or shrimp and lemon slices. Commonly associated with paella, a traditional dish from Spain. May be used for eating, cooking, dining, and meals more generally.', '🥘', ' Shallow Pan of Food');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1800, 'A pot, as a casserole dish, filled with a warm and hearty beef or vegetable stew on most platforms. Samsung’s design resembles a bowl of ramen or other noodle dish, with chopsticks. Generally used for eating and cooking (“a meal”), and commonly associated with soup or Japanese nabe.', '🍲', ' Pot of Food');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1801, 'A bowl with a silver spoon inside, as used to eat cereal or soup. Bowl color varies across platforms, as do contents. Android depicts breakfast cereal, WhatsApp tomato soup; Apple’s is empty.', '🥣', ' Bowl With Spoon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1802, 'An undressed garden salad in a bowl with leafy-green lettuce and other ingredients such as tomato, red onion, and black olives. Commonly associated with healthy eating and living.', '🥗', ' Green Salad');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1803, 'The buttery-white snack of popcorn brimming in a classic red-and-white-striped carton, as enjoyed at a movie theater. ', '🍿', ' Popcorn');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1804, 'A clear glass shaker of salt with a silver cap, as paired with pepper to season food when eating at a restaurant.', '🧂', ' Salt');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1805, 'A can or tin of food, depicted as tomatoes or a generic green vegetable. May be also used to represent sauce.', '🥫', ' Canned Food');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1806, 'A Japanese bento, a lunch box divided into portions of rice, vegetables, and meat or seafood, such as sushi or fried shrimp.', '🍱', ' Bento Box');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1807, 'A Japanese senbei, or rice cracker, wrapped with a sheet of nori, or seaweed, a snack commonly enjoyed with green tea.', '🍘', ' Rice Cracker');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1808, 'A Japanese onigiri, a cone-shaped ball of white rice, a snack wrapped with a sheet of nori, or seaweed.', '🍙', ' Rice Ball');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1809, 'A bowl of steamed white rice, a staple component of cuisine throughout Asia. Bowl color varies across platforms, though is often white.', '🍚', ' Cooked Rice');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1810, 'A plate of orange-brown curry with vegetables or meat, served with a mound of white rice. May represent kare-raisu, or Japanese curry, though commonly associated with India and other Asian cuisines.', '🍛', ' Curry Rice');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1811, 'A bowl of steaming-hot food. Depicted as Japanese ramen (noodles in broth) with chopsticks on most platforms, though it can represent a warm meal more generally. Samsung’s design resembles Pot of Food.', '🍜', ' Steaming Bowl');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1812, 'A plate of Italian spaghetti with tomato sauce, as a bolognese, with a fork twirling its long, thin noodles. Garnished with a green herb, as parsley, on some platforms.', '🍝', ' Spaghetti');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1813, 'A sweet potato depicted with textured purple, orange, or brown skin and sliced in half to show its golden-brown flesh. Sometimes called a yam, though they are unrelated. Not to be confused with the Potato.', '🍠', ' Roasted Sweet Potato');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1814, 'A skewer of three bites of Japanese oden, a winter dish made with fishcakes, tofu, konnyaku, and a variety of other ingredients, including boiled eggs. Often served as a stew or skewered and dipped into soy sauce. Resembles the Dango and may be used for other skewered foods (e.g., shish kebab, roasting marshmallows) or spears.', '🍢', ' Oden');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1815, 'Japanese sushi, generally depicted as two pieces of raw pinkish-orange fish, as tuna or salmon, on white rice (nigiri). Some platforms show the cylindrical maki, a piece of seafood, vegetables, and white rice wrapped in seaweed (nori).', '🍣', ' Sushi');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1816, 'A prawn or shrimp breaded and deep-fried golden-brown. Known as ebi furai in Japan but commonly called shrimp tempura and served in a bento box. Not to be confused with the Shrimp.', '🍤', ' Fried Shrimp');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1817, 'A slice of Japanese narutomaki, a ridged fishcake of processed whitefish with an iconic pink swirl, often served in ramen or oden. Thanks to its distinct swirl, may be used for flair.', '🍥', ' Fish Cake With Swirl');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1818, 'The round, golden-brown pastry of a Chinese mooncake, a traditional delicacy and lunar symbol of the Mid-Autumn Festival. Many platforms feature a design or character imprinted on the crust, and depict a slice cut out to show a brown paste with a duck egg yolk inside. Twitter displays the Chinese character for “fall/autumn” or “harvest” (秋) on top.', '🥮', ' Moon Cake');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1819, 'A Japanese sweet dumpling made from rice flour and served on a skewer. Depicted as a botchan dango, comprising a pink, white or light yellow, and green ball, as colored by red beans, egg, and green tea. Resembles the Oden and featured in the Moon Viewing Ceremony, used in the Japanese festival to celebrate the full moon. ', '🍡', ' Dango');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1820, 'A dumpling of dough and filling, as folded and pinched closed for steaming or frying. Associated with cuisines around the world, including China (jiaozi), Japan (gyoza or dango), Poland (pierogi), and Spain and Latin America (empanada). Facebook''s design resembles a xiaolongbao, a Chinese soup dumpling.', '🥟', ' Dumpling');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1821, 'A golden-brown, crescent-shaped, vanilla-flavored fortune cookie. Usually depicted with a strip of paper—on which a wise saying, lucky numbers, or Chinese vocabulary is written—peaking out of its hollow shell. Given at the end of meals at Chinese restaurants in the West.', '🥠', ' Fortune Cookie');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1822, 'A tall, folded, paper carton, usually white, as used for takeout/takeaway food at Western Chinese restaurants. Most platforms depict chopsticks inside its open lid, labeled with a red, multi-tiered, traditional Chinese building. Also called an oyster pail.', '🥡', ' Takeout Box');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1823, 'A swirl of soft-serve ice cream atop a wafer-style cone, white or cream-colored, as vanilla, on most platforms. Facebook’s design suggests strawberry. May be used more generally for ice cream, frozen yogurt, and frozen treats.', '🍦', ' Soft Ice Cream');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1824, 'A mound of shaved ice (snow cone) served in a dessert bowl with a short spoon, flavored with a cherry-red syrup on many platforms. Associated with Hawaiian shave ice or Japanese kakigori.', '🍧', ' Shaved Ice');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1825, 'One or more scoops of ice cream in a dessert bowl, variously topped with sprinkles, wafer rolls, or cherry and syrup. Flavors vary from vanilla, chocolate, and/or strawberry across platforms.', '🍨', ' Ice Cream');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1826, 'A chocolate-glazed donut (or doughnut) with rainbow sprinkles. WhatsApp features a pink glaze associated with The Simpsons. May resemble the Bagel at small sizes.', '🍩', ' Doughnut');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1827, 'A golden-brown chocolate chip cookie, or biscuit, though representing the baked treat more generally. Samsung, which features a pair of cookies, previously displayed this as two saltine crackers.', '🍪', ' Cookie');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1828, 'A frosted cake with lit candles, as presented for a birthday celebration. The style of cake widely varies across platforms. With white frosting and strawberries, Apple and Google’s designs suggest a Japanese Christmas cake. Other vendors depict a chocolate, pink, and/or sponge cake.', '🎂', ' Birthday Cake');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1829, 'A slice of strawberry shortcake, layered with whipped cream and topped with a whole strawberry. Like the Birthday Cake, may be used to represent birthday celebrations or cake in general.', '🍰', ' Shortcake');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1830, 'An individual cupcake in a liner topped with a swirl of frosting and sprinkles. The style of cupcake widely varies across platforms. The cake may be sponge or chocolate, the frosting pink or white, and the sprinkles rainbow or red.', '🧁', ' Cupcake');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1831, 'A baked dish with a pastry crust, filled with sweet or savory ingredients. Appearance widely varies by platform. Apple depicts a whole pie in a tin, its crimped crust scored to let out steam. Google shows a slice of pumpkin pie as served at Thanksgiving, WhatsApp and Twitter a slice of cherry pie.', '🥧', ' Pie');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1832, 'A block of dark chocolate, usually shown in a red foil wrapper peeled back to show squares of the candy. WhatsApp displays the wrapper in purple, a color commonly associated with Cadbury chocolate.', '🍫', ' Chocolate Bar');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1833, 'A small piece of round, hard sugar candy, as handed out on Halloween, wrapped with two twists on its ends. Candy and wrapper color vary widely by platform. Facebook’s design resembles a classic, unwrapped red-and-white peppermint. May also be called sweets or lollies.', '🍬', ' Candy');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1834, 'A colorful swirl of hard candy on a stick, called a lollipop. Color varies widely by platform: Google displays rainbow colors, Android shades of pink, and Samsung a candy-cane-colored pinwheel.', '🍭', ' Lollipop');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1835, 'A golden-yellow custard dessert, as a crème caramel or flan, topped with a layer of caramel. Shown on a plate, molded in a ramekin-shape and often in a pool of caramel sauce.', '🍮', ' Custard');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1836, 'A golden-yellow pot of honey, as made by bees and desired by bears. Shown with the sweet substance oozing down its sides, often with a honey dipper inside the small vessel. ', '🍯', ' Honey Pot');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1837, 'A bottle of milk or formula, as or fed to a baby, with a bluish cap and rubber nipple or teat. Positioned upright or at a 45° angle, and filled to various levels, sometimes showing fill lines. Often used for newborns and childrearing. See also Breast-Feeding.', '🍼', ' Baby Bottle');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1838, 'A tall glass of white milk, as from a cow but also other mammals, nuts, or plants. Most platforms depict a glass filled near to the brim, but some show a glass half-full—or half-empty.', '🥛', ' Glass of Milk');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1839, 'A cup of a steaming-hot beverage, usually taken as coffee or tea. Sometimes shown on a saucer. Samsung features a foamy-white tulip latte art design.', '☕', ' Hot Beverage');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1840, 'A cup of green tea, as the minty-colored Japanese matcha, usually shown on a wooden mat. Matcha is traditionally served in a small bowl that resembles a cup without a handle. Often taken as a bowl of soup, such as a split pea.', '🍵', ' Teacup Without Handle');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1841, 'Japanese sake, an alcoholic beverage made from rice. Shown as a sake set with a carafe (tokkuri) and drinking cup (choko). Color varies widely by platform, with Apple, WhatsApp, and Twitter featuring blue, a traditional ceramic color. Samsung displays the Japanese script for “sake” in red.', '🍶', ' Sake');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1842, 'A green bottle of champagne or sparkling wine with label, its cork popping to shoot out its bubbly contents. Used for a range of celebratory occasions, such as New Year''s Eve, birthdays, weddings, or other life accomplishments. ', '🍾', ' Bottle With Popping Cork');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1843, 'Red wine served in a stemmed glass. Google previously displayed an orange-colored drink that resembled cognac.', '🍷', ' Wine Glass');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1844, 'A stemmed glass with a cone-shaped bowl, used for serving cocktails. Depicted as a martini garnished with an olive. Might be gin or vodka, shaken or stirred. See also Tropical Drink.', '🍸', ' Cocktail Glass');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1845, 'A sunset-orange-colored tropical beverage in a stemmed glass, as a rum punch or mai tai. Served with a straw and fruit garnish. Many platforms include a cocktail umbrella, hence umbrella drink. Samsung previously featured an electric-blue concoction. See also Cocktail Glass.', '🍹', ' Tropical Drink');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1846, 'A beer, as a golden-colored lager, in a frosty mug. Depicted with a frothy head spilling over the brim. Clinking Beer Mugs is a variation that displays two such beer mugs.', '🍺', ' Beer Mug');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1847, 'Two frosty mugs of beer with frothy heads being clinked together, as done at a celebratory or convivial toast (“Cheers!”). Several platforms include stylized lines to mark the clinking. See also Clinking Glasses.', '🍻', ' Clinking Beer Mugs');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1848, 'Two flutes of champagne or sparkling wine being clinked together, as done at a celebratory or convivial toast (“Cheers!”). Samsung’s design suggests two glasses of white wine. Some platforms include stylized links to mark the clinking. See also Clinking Beer Mugs—and Bottle With Popping Cork for a refill.', '🥂', ' Clinking Glasses');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1849, 'A short, flat glass, as used for brown liquors like whiskey or Scotch whisky. Apple and WhatsApp serve theirs neat, while other platforms include ice ("on the rocks"). Samsung''s glass features the faint initials ONI, an apparent in-company easter egg.  ', '🥃', ' Tumbler Glass');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1850, 'A drinking cup with a straw. Depicted on many platforms as a disposable cup with a lid and bendy straw, as used to serve soft drinks at fast-food restaurants. May be used for a range of non-alcoholic beverages, including milkshakes, smoothies, juice, and to-go beverages.', '🥤', ' Cup With Straw');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1851, 'A pair of equal-length chopsticks, an eating utensil used throughout East Asia. Design and color vary widely by platform, though often red or wood-colored and with tips angled together. Featured in many platforms'' Steaming Bowl of Food and Takeout Box. A counterpart to utensils such as Fork and Knife and Spoon.', '🥢', ' Chopsticks');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1852, 'A silver fork and knife on either side of a white plate, as set for dinner or another meal. Often used more generally for eating and dining. May be paired with Spoon.  ', '🍽', ' Fork and Knife With Plate');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1853, 'A silver fork to the left of a knife, silverware or cutlery used to eat a meal. Often used more generally for eating and dining. May be paired with Spoon or used with Fork and Knife With Plate.', '🍴', ' Fork and Knife');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1854, 'A silver spoon, as used to eat soup, cereal, or ice cream as well as serve food or stir drinks. Positioned at various angles across platforms. May be paired with Fork and Knife, Fork and Knife With Plate, and Bowl With Spoon.', '🥄', ' Spoon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1855, 'A versatile type of knife commonly found in kitchens in Japan. Generally used for cutting and filleting meat and fish.', '🔪', ' Kitchen Knife');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1856, 'A ceramic, vase-like object. Can be used in relation to the zodiac symbol Aquarius.', '🏺', ' Amphora');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1857, 'The world, showing Europe and Africa.', '🌍', ' Globe Showing Europe-Africa');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1858, 'The world, showing North and South America.', '🌎', ' Globe Showing Americas');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1859, 'The world, showing Asia and Australia.', '🌏', ' Globe Showing Asia-Australia');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1860, 'A symbol of planet earth showing lines of longitude and latitude. Commonly used as an icon for internationalization, and features on the iOS software keyboard to change keyboard languages.', '🌐', ' Globe With Meridians');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1861, 'A map of planet earth, shown on some platforms as a physical paper map with crease lines where it has been folded. This emoji may also be shown as a world map image.', '🗺', ' World Map');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1862, 'Shows a map of the country of Japan, which is the only country to have its own emoji map. Other countries can be found on the various globe emojis, or the world map emoji.', '🗾', ' Map of Japan');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1863, 'A navigational compass, showing points for North, East, South, and West.', '🧭', ' Compass');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1864, 'A mountain with snow resting at higher altitudes. Similar in appearance to the Mount Fuji emoji.', '🏔', ' Snow-Capped Mountain');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1865, 'A mountain shown with two peaks and blue sky. Similar to the snow capped mountain emoji.', '⛰', ' Mountain');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1866, 'A volcano, erupting with smoke and lava.', '🌋', ' Volcano');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1867, 'Mount Fuji (called Fuji-san in Japan) is the largest mountain in Japan. Often seen with snow on the peak in colder months of the year.', '🗻', ' Mount Fuji');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1868, 'A campsite featuring a tent and a tree, and perhaps a campfire. Similar to the tent emoji.', '🏕', ' Camping');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1869, 'A beach showing sand, and an umbrella for protection from the sun.', '🏖', ' Beach With Umbrella');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1870, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1871, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1872, 'A national park, generally displayed with mountains, a river or stream, and trees.', '🏞', ' National Park');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1873, 'A large capacity stadium, featuring a large amount of seating for sporting fans, or people attending other shows hosted by the stadium.', '🏟', ' Stadium');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1874, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1875, 'A construction site generally depicted as a tower crane shown lifting steel or other building materials.', '🏗', ' Building Construction');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1876, 'Multiple houses.', '🏘', ' Houses');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1877, 'A house which is unoccupied, and has become derelict. In a state of disrepair.', '🏚', ' Derelict House');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1878, 'A house, otherwise known as a home when someone is living in it. Suitable for a couple or larger family, other perhaps housemates.', '🏠', ' House');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1879, 'A suburban-looking house, with a tree, flower, or shrubs around it in the garden.', '🏡', ' House With Garden');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1880, 'A brick or bricks used in the construction of a house, wall, or as a single object. May be used as a verb “to brick” which is to “to render (an electronic device, such as a smartphone) nonfunctional” according to Meriam-Webster.', '🧱', ' Brick');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1881, 'A generic, high-rise office building. Generally found in cities, and most active during business hours.', '🏢', ' Office Building');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1882, 'A Japanese post office, featuring the テ Japanese postal mark on the front of the building (or showing this mark instead of the building in Microsoft’s artwork).', '🏣', ' Japanese Post Office');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1883, 'A European-style post office. A postal horn can be seen on the front, which is commonly found in the logos of European Postal Services.', '🏤', ' Post Office');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1884, 'A place where people are taken to receive medical care. This hospital has a large red cross on the front, often used as a symbol for health care.', '🏥', ' Hospital');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1885, 'A retail bank branch, where people can perform money-related tasks. Also a common location to find an ATM.', '🏦', ' Bank');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1886, 'A hotel building, displayed on most platforms as a building with many windows and a letter H on the front.', '🏨', ' Hotel');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1887, 'A love hotel is a hotel that can be hired by the hour, instead of as accommodation for the evening.', '🏩', ' Love Hotel');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1888, 'A shop that is generally open for longer hours than a regular supermarket, sometimes 24 hours per day.', '🏪', ' Convenience Store');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1889, 'A school building with multiple storeys, and a clock on the front. A place that children, or teenagers attend for their education.', '🏫', ' School');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1890, 'A large department store, selling a range of products to the general public. Shown as a large building with a billboard on most platforms, or as a shopping bag on Windows.', '🏬', ' Department Store');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1891, 'An industrial factory, with flue-gas stacks releasing exhaust into the air.', '🏭', ' Factory');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1892, 'A traditional Japanese Castle, usually made from stone and wood.', '🏯', ' Japanese Castle');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1893, 'A castle, in a style that can be found in France and other parts of Europe.', '🏰', ' Castle');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1894, 'An emoji to depict a wedding, displayed by most vendors as a Christian church and love hearts. Some platforms display a cross or bell on the building.', '💒', ' Wedding');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1895, 'The Tokyo Tower is the second-tallest building in Japan, located in Minato, Tokyo.', '🗼', ' Tokyo Tower');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1896, 'The Statue of Liberty, often used as a depiction of New York City.', '🗽', ' Statue of Liberty');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1897, 'A church building, generally associated with Christian denominations. In addition quiet prayer, churches hold regular worship services, weddings, baptisms and funerals.', '⛪', ' Church');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1898, 'A mosque building, a place of worship for followes of Islam. Shown with a domed roof and a minaret.', '🕌', ' Mosque');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1899, 'A synague; a place of worship for followers of Judaism. Displayed with a Star of David on the front.', '🕍', ' Synagogue');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1900, 'A shrine used for the Japanese Shinto religion. This emoji generally displays the torii, which is the gate to the Shinto Shrine. The torii is generally a red colored structure, with a curved roof section above two posts.', '⛩', ' Shinto Shrine');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1901, 'A cube-shaped building located at the centre of the Al-Masjid al-Haram Mosque in Mecca.', '🕋', ' Kaaba');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1902, 'A water fountain, found in a park or other public space. Used for decorative purposes. A variety of styles of fountain are shown across different platforms.', '⛲', ' Fountain');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1903, 'A tent, used for protection from wind and rain when camping. Often shown at night time, under stars.', '⛺', ' Tent');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1904, 'Foggy weather displayed as fog covering a bridge or cityscape, depending on the platform. For platforms that show a bridge, the red Golden Gate Bridge is generally displayed.', '🌁', ' Foggy');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1905, 'A night sky with stars, depicted on major platforms as a cityscape at night.', '🌃', ' Night With Stars');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1906, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1907, 'The sun rising over a mountain range, early in the morning.', '🌄', ' Sunrise Over Mountains');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1908, 'A sun rising, early in the morning. Can be difficult to distinguish from a sunset in some versions of this artwork.', '🌅', ' Sunrise');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1909, 'A view of city buildings as the last light disappears from the sky. An orange (or blue) glow lingers, before the stars of the night sky become visible.', '🌆', ' Cityscape at Dusk');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1910, 'A beautiful view, featuring an orange sky, with the sun setting over the buildings of a city skyline.', '🌇', ' Sunset');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1911, 'A lit-up bridge, shown at night.', '🌉', ' Bridge at Night');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1912, 'Representation of hot springs with steam rising from a circular tub. This is the common symbol used to represent an onsen on maps in Japan.', '♨', ' Hot Springs');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1913, 'The Milky Way – a galaxy of billions of stars that includes our own solar system and planet earth.', '🌌', ' Milky Way');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1914, 'A wooden painted horse, found on the carousel at a carnival. Faces to the left-of screen.', '🎠', ' Carousel Horse');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1915, 'A large rotating wheel, often found at a carnival or fair.', '🎡', ' Ferris Wheel');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1916, 'A roller coaster in a theme park going down a dip in the ride. Three carriages can be seen with two people in each red carriage.', '🎢', ' Roller Coaster');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1917, 'A pole with red, white and blue stripes. Traditionally used by barbers out the front of their place of work. May be used in parts of Asia to denote a brothel.', '💈', ' Barber Pole');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1918, 'A circular ‘big top’ circus tent, with a triangle flag on top.', '🎪', ' Circus Tent');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1919, 'A steam train, powered by coal or wood. An early type of locomotive, now mostly replaced by electric or diesel trains.', '🚂', ' Locomotive');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1920, 'A railway (railroad) car (carriage) that is generally pulled along a railway line by a locomotive. Shown with a pantograph above the carriage on many platforms which makes it look more like a tram car.', '🚃', ' Railway Car');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1921, 'A high speed train, designed to cover long distances at high speed.', '🚄', ' High-Speed Train');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1922, 'A high speed train, designed to cover long distances at high speed. Also features a streamlined bullet nose, often used in reference to the Shinkansen in Japan.', '🚅', ' Bullet Train');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1923, 'A train, of no specified type. Due to the presence of a steam train and fast train emoji, this is likely to be a regular electrified or diesel passenger train.', '🚆', ' Train');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1924, 'A metro: frequent underground train found in built-up areas with high populations.', '🚇', ' Metro');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1925, 'A form of public transport similar to a tram, but running on a track or network separated from cars and other types of traffic.', '🚈', ' Light Rail');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1926, 'A station, presumed to be a train station. Displays a train alongside a platform, where passengers can board.', '🚉', ' Station');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1927, 'A form of public transport on rails, usually found on streets in cities or other urban areas. For short or medium-length journeys.', '🚊', ' Tram');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1928, 'Similar to a train, but running on a single track. Monorails are often found at theme parks, or other tourist destinations.', '🚝', ' Monorail');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1929, 'A train and railway in the mountains. Displayed as a funicular in Microsoft’s artwork, or a regular train on other platforms.', '🚞', ' Mountain Railway');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1930, 'A form of public transport on rails, usually found on streets in cities or other urban areas. For short or medium-length journeys.', '🚋', ' Tram Car');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1931, 'A bus used for public transport in cities and towns. Could also be used as a school bus.', '🚌', ' Bus');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1932, 'The front of a bus, showing the windscreen, as well as wing mirrors in some versions of this emoji.', '🚍', ' Oncoming Bus');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1933, 'A type of bus that uses overhead electrical wires for power. Appears similar to a cross between a bus and a tram car.', '🚎', ' Trolleybus');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1934, 'A small bus, designed to carry less people than a full-sized bus.', '🚐', ' Minibus');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1935, 'An ambulance, used to transport patients between their home and the hospital.', '🚑', ' Ambulance');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1936, 'A red fire truck, an essential part of emergency services along with a police car or ambulance.', '🚒', ' Fire Engine');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1937, 'A police car, shown with an emergency light on the top.', '🚓', ' Police Car');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1938, 'A police car, shown with an emergency light on the top.', '🚔', ' Oncoming Police Car');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1939, 'A yellow taxicab, iconically seen in New York City. Shown from the side, as opposed to the oncoming taxi emoji.', '🚕', ' Taxi');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1940, 'A yellow taxicab, iconically seen in New York City. Shown from the front, as opposed to the taxi emoji which displays the side of the vehicle.', '🚖', ' Oncoming Taxi');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1941, 'A car / automobile shown from the side, facing right-to-left. Appears as a red car on most platforms (which goes faster), except on Android where this displays as a silver car (previously blue).', '🚗', ' Automobile');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1942, 'A car, being shown from the front. The windscreen and hood (bonnet in British English) of the car can be seen. facing forward.', '🚘', ' Oncoming Automobile');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1943, 'A vehicle used for recreation, which is generally understood to mean a campervan or motorhome.', '🚙', ' Sport Utility Vehicle');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1944, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1945, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1946, 'A tractor, may be used by a farmer or other occupation on the land.', '🚜', ' Tractor');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1947, 'A bicycle, sometimes called a push bike, used for transport or sport.', '🚲', ' Bicycle');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1948, 'A non-motorized scooter, with two wheels and handles.', '🛴', ' Kick Scooter');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1949, 'A skateboard emoji, shown on some platforms from the top and others showing the under-side of the board.', '🛹', ' Skateboard');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1950, 'A motor scooter, which may be displayed as any type of motorbike with or without a step-through frame. Distinct from the racing motorcycle, which is used for sport, not transport.', '🛵', ' Motor Scooter');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1951, 'A sign indicating the location of a bus stop by the side of a road.', '🚏', ' Bus Stop');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1952, 'A wide road shown from a first person perspective. Apple''s artwork displays a road sign to Curpertino.', '🛣', ' Motorway');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1953, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1954, 'A barrell or drum that contains oil. The exterior of this cylinder is shown in blue, with two holes on the top.', '🛢', ' Oil Drum');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1955, 'A fuel pump, used to fill up a vehicle with gas / petrol.', '⛽', ' Fuel Pump');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1956, 'A revolving red light seen on top of a police car. Often used in emergency circumstances in addition to a siren making a loud warning sound.', '🚨', ' Police Car Light');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1957, 'A set of red, orange (amber) and green traffic lights, used at intersections. Less common than the vertical traffic light.', '🚥', ' Horizontal Traffic Light');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1958, 'A set of red, orange (amber) and green traffic lights, used at intersections. More common than the horizontal traffic light.', '🚦', ' Vertical Traffic Light');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1959, 'A red, octagonal sign. Used in many countries as a stop sign.', '🛑', ' Stop Sign');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1960, 'A sign used to indicate roadwork or construction. Generally shown as yellow and black diagonal stripes, and often used to physically block access to a road or area.', '🚧', ' Construction');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1961, 'A metal device, dropped out of a boat to prevent it drifting away from the current location.', '⚓', ' Anchor');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1962, 'A sailboat, otherwise known as a sailing boat or yacht.  Uses wind as the source of propulsion to move around a body of water.', '⛵', ' Sailboat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1963, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1964, 'A motorized speedboat used for recreation on lakes, or other bodies of water.', '🚤', ' Speedboat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1965, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1966, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1967, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1968, 'A large ship, used for transport of people or cargo across the ocean. May be a cruise ship, commonly found around tropical locations.', '🚢', ' Ship');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1969, 'Used either as a literal airplane, or sometimes to represent an overseas vacation, or airplane mode on a phone or tablet.', '✈', ' Airplane');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1970, 'A light aircraft which is shown with propellers on some platforms.', '🛩', ' Small Airplane');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1971, 'A plane taking off from a runway. Generally displayed left-right, with the front of the plane elevated.', '🛫', ' Airplane Departure');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1972, 'A plane approaching a runway for landing. Generally displayed left-right, with the front of the plane facing toward the ground in a position that may result in a crash if attempted in the real world.', '🛬', ' Airplane Arrival');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1973, 'A seat, which could refer to any form of place to sit, with the distinction that a seat is generally fixed, and is not a chair (which can be moved).', '💺', ' Seat');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1974, 'A helicopter, which can hover in the air. Often seen in emergency circumstances such as transporting patients to a hospital, or for police or fire-fighting activity.', '🚁', ' Helicopter');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1975, 'Similar to a monorail, a suspension railway is elevated, but the vehicle is suspended under the track.', '🚟', ' Suspension Railway');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1976, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1977, 'An Aerial Tramway, most commonly seen at ski resorts, for transport between locations on a mountain. Can also be used as a tourist attraction, or as a form of public transport.', '🚡', ' Aerial Tramway');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1978, 'A satellite which orbits the earth, and is generally used for communications, weather, and GPS.', '🛰', ' Satellite');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1979, 'A rocket being propelled into space.', '🚀', ' Rocket');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1980, 'A flying saucer, sometimes referred to as an Unidentified Flying Object (UFO). Shown on some platforms with an alien at the controls and/or a beam of light emitting from the base.', '🛸', ' Flying Saucer');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1981, 'A bell used to call attention at a reception or other desk. Goes "ding!" or "tink!" when pressed.', '🛎', ' Bellhop Bell');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1982, 'Luggage, possibly on wheels to differentiate from the briefcase emoji.', '🧳', ' Luggage');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1983, 'An hourglass, generally shown without flowing sand.', '⌛', ' Hourglass Done');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1984, 'An hourglass with sand flowing, representing the passage of time.', '⏳', ' Hourglass Not Done');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1985, 'A wrist watch, which is generally displayed as an analogue portable timepiece. Apple’s emoji artwork displays an Apple Watch, instead of a traditional watch that is shown on other platforms shown.', '⌚', ' Watch');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (1986, 'A small clock with two bells to scare a person awake at a pre-set time.', '⏰', ' Alarm Clock');
