INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2023, 'A moon with a face, hiding in shadow. Sometimes perceived to be creepy, this is a regular new moon, with a face on it.', '🌚', ' New Moon Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2024, 'A crescent moon shape, showing a face looking left.', '🌛', ' First Quarter Moon Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2025, 'A crescent moon shape, showing a face looking right.', '🌜', ' Last Quarter Moon Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2026, 'A thermometer, used as a way to measure temperature. May be used in relation to weather (generally hot), or illness.', '🌡', ' Thermometer');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2027, 'The sun; a warm ball of fire that keeps life on earth viable. Represents sunny weather, or hot days.', '☀', ' Sun');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2028, 'A smiling full moon, sometimes said to have a slightly creepy face. Not to be confused with the full moon that has no face.', '🌝', ' Full Moon Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2029, 'A yellow sun with a kind, smiling face. Not your typical smiling sun with big grin and sunglasses.', '🌞', ' Sun With Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2030, 'A five-point star of pale-yellow color. Generally used for visual flair rather than astronomical purposes.', '⭐', ' Star');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2031, 'A five-point star of pale-yellow color, with small bursts of light shining around it. Generally used for visual flair rather than astronomical purposes.', '🌟', ' Glowing Star');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2032, 'A star displaying a path of light behind it, indicating movement through the sky.', '🌠', ' Shooting Star');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2033, 'A cumulus cloud, which shows on some systems as a silhouette in black, and on other systems as a shaded white cloud.', '☁', ' Cloud');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2034, 'A sun appearing from behind a cloud. Used in weather forecasts to indicate a partially sunny day.', '⛅', ' Sun Behind Cloud');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2035, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2036, 'The sun, with a small cloud in the foreground. The majority of the sun is visible.', '🌤', ' Sun Behind Small Cloud');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2037, 'The sun shown behind a cloud, with about 20% of it visible. Very similar to the sun behind cloud emoji, but with less sun visible.', '🌥', ' Sun Behind Large Cloud');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2038, 'Raindrops falling from a cloud, with the sun shown in the background (half covered by the cloud). The combination of sun and rain may cause a rainbow to appear in the sky.', '🌦', ' Sun Behind Rain Cloud');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2039, 'Raindrops falling from a cloud. People standing under it should probably use an umbrella to keep dry.', '🌧', ' Cloud With Rain');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2040, 'A cloud with small snowflakes drifting from it.', '🌨', ' Cloud With Snow');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2041, 'A storm cloud with a bolt of lightning coming out of it.', '🌩', ' Cloud With Lightning');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2042, 'A tornado appearing to come from within a cloud in the sky.', '🌪', ' Tornado');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2043, 'Fog or haze lingering in the air. Similar to the foggy emoji, but generally shown without objects or views being obstructed by fog.', '🌫', ' Fog');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2044, 'The face of a Mother Nature character, creating wind by blowing air from her mouth.', '🌬', ' Wind Face');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2045, 'An icon used to represent a cyclone. Some versions of this emoji show a spiral shape, which may be used for decorative purposes.', '🌀', ' Cyclone');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2046, 'A pretty rainbow emoji in a clear sky, which tends to appear when there is a light rain or mist in the air, at the same time as sunshine.', '🌈', ' Rainbow');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2047, 'An umbrella that is closed, likely as a result of collapsing it prior to going indoors.', '🌂', ' Closed Umbrella');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2048, 'An umbrella with a hooked handle, open and with no rain falling on it, unlike the umbrella with raindrops.', '☂', ' Umbrella');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2049, 'An umbrella with a hooked handle, displayed open with rain drops falling on it. The color of this umbrella varies by platform.', '☔', ' Umbrella With Rain Drops');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2050, 'An umbrella planted on the ground for shade protection, often at a beach or park.', '⛱', ' Umbrella on Ground');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2051, 'Most commonly used as a lightning bolt for stormy weather, this symbol is intended to be a warning for high voltage', '⚡', ' High Voltage');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2052, 'Snow falling to the ground in the form of a unique ❄ snowflake. With enough snow, a snowman can be made!', '❄', ' Snowflake');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2053, 'A snowman emoji, made out of snow (usually by children) in winter. This emoji is distinct from Snowman Without Snow as this variation features falling snow.', '☃', ' Snowman');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2054, 'A snowman emoji, made out of snow (usually by children) in winter. The name Snowman Without Snow indicates that it is not snowing on the snowman.', '⛄', ' Snowman Without Snow');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2055, 'A streaking comet, appearing as a ball of light, with a light streak behind it. Similar to the shooting star emoji.', '☄', ' Comet');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2056, 'A small flame, mostly yellow but red at the top. Can be used to describe something or someone being hot, or in the context of being exemplary (lit, slang).', '🔥', ' Fire');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2057, 'A single drop of water, or another blue liquid. May be used as a single drop of sweat.', '💧', ' Droplet');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2058, 'A wave in the ocean or open sea. Could be used to surf on, or to jump waves at the beach.', '🌊', ' Water Wave');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2059, 'A pumpkin emoji, carved into a Jack-o’-lantern for halloween.', '🎃', ' Jack-O-Lantern');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2060, 'A decorated Christmas Tree emoji: a pine tree displayed at Christmas time, usually adorned with lights, tinsel and other ornaments. Presents are commonly placed at the bottom of the tree.', '🎄', ' Christmas Tree');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2061, 'Firework emoji, showing a explosion of colored light in the night sky, used for any number of celebrations such as New Year''s Eve.', '🎆', ' Fireworks');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2062, 'A  sparkler: a form of hand-held firework often used at parties and celebrations. The sparkler is lit at one end, and held at the other. ', '🎇', ' Sparkler');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2063, 'A firecracker used in many celebratory events. Looks somewhat like a stick of dynamite.', '🧨', ' Firecracker');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2064, 'Decorative sparkling stars, the kind that may be indicate an item as being ‘sparkling clean’ (very clean) or shiny.', '✨', ' Sparkles');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2065, 'A single balloon, used for birthdays and other celebrations. Displayed as red on most platforms, except Samsung  which displays a blue balloon.', '🎈', ' Balloon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2066, 'A colorful party popper, used for party or other celebration. Appears as a conical party hat, with streamers or confetti bursting out of one end.', '🎉', ' Party Popper');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2067, 'Confetti Ball emoji: a ball containing confetti, burst open at celebrations such as New Year’s Eve or a Wedding in a celebratory manner.', '🎊', ' Confetti Ball');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2068, 'A tree that people use to attach pieces of paper containing good wishes. Often done for spiritual or religious reasons, in many cultures.', '🎋', ' Tanabata Tree');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2069, 'This pine decoration, called kadomatsu in Japanese, is made of bamboo or pine.', '🎍', ' Pine Decoration');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2070, 'Two Japanese Imperial Dolls, displayed on March 3 for Hina-matsuri (Dolls Day, Girls Day).', '🎎', ' Japanese Dolls');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2071, 'Carp-shaped wind socks traditionally flown in Japan to celebrate Children’s Day.', '🎏', ' Carp Streamer');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2072, 'Although named wind chime, this emoji more closely resembles a wind bell; a decoration that is popular in Japan and made of glass.', '🎐', ' Wind Chime');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2073, 'Moon Viewing Ceremonies (called Tsukimi in Japan) are held each year in autumn to celebrate the full moon and waxing moon in Japan.', '🎑', ' Moon Viewing Ceremony');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2074, 'A red envelope given with money in many Chinese or other East Asian and Southeast Asian traditions. Red, usually with decorative gold words or patterns on the outside.', '🧧', ' Red Envelope');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2075, 'A pretty ribbon, tied in a bow.', '🎀', ' Ribbon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2076, 'A gift, wrapped with a variety of paper colors, and a ribbon and bow for decoration.', '🎁', ' Wrapped Gift');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2077, 'An awareness ribbon, worn to show support of a cause or group.', '🎗', ' Reminder Ribbon');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2078, 'A ticket or tickets to an event that may say "Admit One" on the front. Shown in pink or yellow on most platforms.', '🎟', ' Admission Tickets');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2079, 'A paper ticket, which may be for a theatre show, sporting event, or other ticketed performance. Shown in blue, yellow or grey on most platforms.', '🎫', ' Ticket');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2080, 'A ribbon and medallion generally awarded to a person in the military for heroic acts.', '🎖', ' Military Medal');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2081, 'A trophy given as an recognition of achievement, usually in sports. The trophy emoji is a gold cup, with a engraving on the bottom detailing the award.', '🏆', ' Trophy');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2082, 'A gold medal, given to a person who has won a sporting event, such as a race. Not to be confused with the military medal emoji.', '🏅', ' Sports Medal');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2083, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2084, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2085, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2086, 'A round, black and white ball used in the game of soccer, which is known as football in much of the world. See also: emojis for the World Cup.', '⚽', ' Soccer Ball');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2087, 'A white baseball, with regulation red stitching. Used in the game of the same name, baseball.', '⚾', ' Baseball');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2088, 'A softball, which is differentiated from a baseball by size (it is larger, though hard to tell in emoji form) and color (yellow, not white).', '🥎', ' Softball');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2089, 'An orange-colored basketball displayed with a hoop. Many versions of this emoji omit the hoop, and display only the basketball.', '🏀', ' Basketball');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2090, 'A volleyball emoji, showing the round ball used in the sport. Played as part of the Summer Olympic Games.', '🏐', ' Volleyball');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2091, 'The oval ball used in the game of American football, known as gridiron in some countries.', '🏈', ' American Football');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2092, 'The oval-shaped ball used in the game of rugby. Varies slightly in shape in the two main versions of the game: rugby union and rugby league.', '🏉', ' Rugby Football');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2093, 'A tennis racket (racquet) with a tennis ball. Only a ball is shown on Apple, LG, Twitter, Facebook, and Mozilla platforms.', '🎾', ' Tennis');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2094, 'A flying disc, more commonly known as a frisbee. Used in the sport of Ultimate.', '🥏', ' Flying Disc');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2095, 'Ten-pin bowling emoji, showing a bowling ball and pins.', '🎳', ' Bowling');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2096, 'A cricket bat, with a cricket ball also shown. May be displayed with a wicket present.', '🏏', ' Cricket Game');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2097, 'A hockey stick and ball, used in the sport of field hockey. Not to be confused with the ice hockey stick and puck.', '🏑', ' Field Hockey');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2098, 'A hockey stick and puck, used in the sport of ice hockey. Not to be confused with the field hockey stick and ball.
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2099, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2100, 'A paddle and ping pong ball used in the sport of table tennis.', '🏓', ' Ping Pong');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2101, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2102, 'A padded boxing glove, used in the sport of boxing. Usually red.', '🥊', ' Boxing Glove');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2103, 'A white uniform used in marital arts such as judo or karate. Held together using a material belt. Known as keikogi in Japanese.', '🥋', ' Martial Arts Uniform');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2104, '
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2105, 'A red, triangular flag shown sitting in the hole of a golf course green. Some versions of this emoji also include golf balls.', '⛳', ' Flag in Hole');
INSERT INTO app_emoji ("Order", Description, Icon, Name) VALUES (2106, 'A single ice skate used for ice skating. Shown in white and facing left on most platforms.', '⛸', ' Ice Skate');
